import React from 'react'
import { Navbar, Button, Nav, NavDropdown } from 'react-bootstrap';
import { useHistory } from 'react-router-dom';

function LoginNav() {
    const user = localStorage.getItem('authUser')
    const history = useHistory();

    function refreshPage() {
        window.location.reload(false);
    }

    function logout() {
        localStorage.setItem('authUser', '');
        refreshPage();
    }

    function profile(){
        history.push('/profile');
    }
    return (
        <>
        <Navbar>
            <Navbar.Brand href="/home" style={{color: "black"}} className="col-md-9 col-sm-6">
            <img
                alt=""
                src="../logo192.png"
                width="30"
                height="30"
                className="d-inline-block align-top"
            />{' '}
            Splitwise
            {' '}
            </Navbar.Brand>
            <Nav className="justify-content-end" activeKey="/home">
                <Nav.Item>
                <Nav.Link href="/home">Home</Nav.Link>
                </Nav.Item>
                <NavDropdown title={user} id="nav-dropdown">
                    <NavDropdown.Item eventKey="4.1" onClick={profile}>Profile</NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item eventKey="4.4" onClick={logout}>Logout</NavDropdown.Item>
                </NavDropdown>
            </Nav>
        </Navbar>
        </>
    )
}

export default LoginNav
